Desert Heat
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

In the desert, no one can hear you scream.Every year, college students head to a deserted motel, for a week of partying and shameless hookups as a break from finals. Stevie Shae plans to do the same with her boyfriend and 3 other couples. Desert Heat is a sexy and enthralling look into these couples' week long tradition of much needed release and hardcore sex. Little do they know, killer Tommy Gunn is on the hunt and the couples face fear as they've never known it. Death lingers upon them while the crazy killed murders one person at a time.

Cast: Riley Reid   Rikki Six   Courtney Taylor (IV)   Stevie Shae   Kendall Karson   Tommy Gunn   Leya Falcon   Seth Gamble   Chad White   Michael Vegas   Keni Styles 

